script: |
  super -f text -I q13192.spq | sort > q13192.out

inputs:
  - name: q13192.spq
    data: |
      SELECT DISTINCT + CAST ( - col0 AS INTEGER ), + col1 + 73 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT + col2 * - + ( + - col0 ) - + - col1 BETWEEN - col0 + + - 24 AND NULL;
  - name: tab2

outputs:
  - name: q13192.out
    data: |
